function Card(card) {
    return (
        <template className="template">
            <div className="props">
                <img className="props__image" src={card.link} alt={card.name}/>
                <button className="props__delete" type="button"></button>
                <div className="props__group">
                    <h3 className="props__text">{card.name}</h3>
                    <div className="props__like-container">
                        <button className="props__like" type="button"></button>
                        <span className="props__like-counter"></span>
                    </div>
                </div>
            </div>
        </template>
    );
}
export default Card;
